import React, { Fragment } from 'react';
import AppPass from './Apppass';

const dummyTodos = [
    {
      id: 1,
      title: 'Todo Title',
      desc: 'Todo One Descripyion Is Here...'
    },
    {
        id: 2,
        title: 'Todo Title',
        desc: 'Todo Two Descripyion Is Here...'
      }
];

const AppHome = () => {
    
       return (
           <Fragment>
               <AppPass TodoPass={dummyTodos}/>
           </Fragment>
       );
   };
   export default AppHome;
